description:
ARTIST....: Various
ALBUM.....: Industrial Legacy Vol. 1
GENRE.....: Electro Industrial
YEAR......: 2006
QUALITY...: 160kbps - 235kbps (VBR/CBR)
TYPE......: Selfmade collection


DESCRIPTION:

Collection of 23 noisy and hard riffed tracks from the world's best
electro industrial artists. This is the music that you want to hear 
when your TV or radio is just feeding that shitty MTV crap. 

There is bunch of decent electro industrial artists in the world but 
only few of them make very good and orginal music. I hope this 
collection gives you something new....

Try it, Love it, Buy it &gt;)   --   Feel free to comment!


